[Help]
Welcome to the ingame help module.
We would like to remind you to visit the Help section on our forums @discoverygc.com for more in-depth explanations as well as the ability to post your questions and receive answers.
For new players to our server and mod, we would like to suggest you use the following commands - /showrestarts and /restart, and pick the BEGINNER or MINER option.
Once you enter the command, you will be disconnected from the server and your character will be updated to a ship with an updated nav-map which will allow you to trade better. The BEGINNER restart is geared towards trading, while the MINER restart is geared towards mining.
Type /commandlist to see a list of possible commands.

[CommandList]
Chat commands: the color of the text shows the chat type. Light blue for system-wide chat, dark blue for local chat (targets on your scanner only), green for private messages, pink for group chat.
/system, /local, /group, /t (while targetting the player), /r (replies to last PM received)
General commands are as follows. Please visit our forums for an in-depth description of their function:/invite, /invite$, /join, /leave, /target, /reply, /privatemsg, /privatemsg$, /factionmsg, /factioninvite, /time,  /showmsgs, /setmsg, /[0-9], /l[0-9], /s[0-9], /g[0-9], /t[0-9], /givecash, /drawcash, /set cashcode, /showcash, /renameme, /pingtarget, /ping, /credits, /ids, /id, /ignoreid, /ignore, /delignore, /set movecharcode, /set chattime, /set chatfont, /set diemsgsize, /set diemsg, /movechar, /mail, /maildel, /coin, /dice, /showinfo, /conn and /return, /pos, /stuck, /droprep, /autobuy, /cloak, /disruptor, /lastpm, /setinfo, /lights, /shields, /marktarget, /nodock
Pimpship commands - /pimpship when at a supporting ship dealer (e.g. on a shipyard)
Tag protection commands - /maketag, /droptag, /settagpass
Jump drive commands - /survey, /showcoords, /savecoords, /c[0-9], /setcoords, /jump, /beacon, /jumpbeacon, /charge, /jumpsys
Player base commands - /base deploy and type /base when docked for more details.
Type command with no parameters to see command details.

